package com.yaowang.lansha.entity;import java.io.Serializable;import java.util.Date;/** * 直播间人数日志  * @author  *  */public class YwUserRoomLog implements Serializable{	private static final long serialVersionUID = 1L;		/**	 * id	 */	private String id;	/**	 * 房间id	 */	private String roomId;	/**	 * 用户id	 */	private String userId;	/**	 * 人数	 */	private Integer number;	/**	 * 创建时间	 */	private Date createTime;		private Date startTime;	private Date endTime;		/**	 * 设置id	 */	 public void setId(String id){	 	this.id = id;	 }	 	 /**	  * 获取id	  */	 public String getId(){	 	return this.id;	 }	/**	 * 设置房间id	 */	 public void setRoomId(String roomId){	 	this.roomId = roomId;	 }	 	 /**	  * 获取房间id	  */	 public String getRoomId(){	 	return this.roomId;	 }	/**	 * 设置用户id	 */	 public void setUserId(String userId){	 	this.userId = userId;	 }	 	 /**	  * 获取用户id	  */	 public String getUserId(){	 	return this.userId;	 }	/**	 * 设置人数	 */	 public void setNumber(Integer number){	 	this.number = number;	 }	 	 /**	  * 获取人数	  */	 public Integer getNumber(){	 	return this.number;	 }	/**	 * 设置创建时间	 */	 public void setCreateTime(Date createTime){	 	this.createTime = createTime;	 }	 	 /**	  * 获取创建时间	  */	 public Date getCreateTime(){	 	return this.createTime;	 }	public Date getStartTime() {		return startTime;	}	public void setStartTime(Date startTime) {		this.startTime = startTime;	}	public Date getEndTime() {		return endTime;	}	public void setEndTime(Date endTime) {		this.endTime = endTime;	}}